const Square = ({ count }) => {

const squareColor = count % 2 === 0 ? 'blue' : 'green'; 

    return (
        <div style={{
            width: '200px',
            height: '200px',
            backgroundColor: squareColor
        }}>
        </div>
    );
}
export default Square;
